/** @format */

import React from "react";
import { Box, Card, CardContent, Typography } from "@mui/material";
import NumberFormat from "react-number-format";

const Cards = ({ data }) => {
  return (
    <>
      <Box
        key={data.id}
        component="span"
        sx={{ display: "inline-block", mx: "1.5rem" }}
      >
        <Card sx={{ minWidth: 275 }}>
          <CardContent>
            <Typography
              sx={{ fontSize: 14 }}
              color="text.secondary"
              gutterBottom
            >
              {data.title}
            </Typography>
            <Typography variant="h3" component="h4">
              <NumberFormat
                value={data.amount}
                displayType={"text"}
                thousandSeparator={true}
                prefix={"$"}
              />
              ;
            </Typography>
          </CardContent>
        </Card>
      </Box>
      <Box>
        <Card sx={{ minWidth: 275 }}>
          <CardContent>
            <Typography
              sx={{ fontSize: 14 }}
              color="text.secondary"
              gutterBottom
            >
              New Matters
            </Typography>
            <Typography variant="h3" component="h4">
              <NumberFormat
                value={3425}
                displayType={"text"}
                thousandSeparator={true}
              />
            </Typography>
          </CardContent>
        </Card>
      </Box>
    </>
  );
};

export default Cards;
